import React from "react";
import SvgIcon from '@mui/material/SvgIcon';
import Googleicon from '../../images/googlemap.png';
import GoogleiconChecked from '../../images/hotpepper.png';

export function GoogleIcon (props) {
  return (
    <SvgIcon
      component="span">

      {props.checked ? 
        <img src={Googleicon} alt="ロゴ" width="50" height="50"></img> 
        :
        <img src={GoogleiconChecked} alt="ロゴ" width="50" height="50"></img>
      }

    </SvgIcon>
  );
};
